/**
 * Central place for all route strings.  Import these instead of literals.
 */
export const ROUTES = {
  // public
  HOME: '/',
  LISTINGS: '/listings',
  LISTING_DETAIL: '/listings/:id',
  LOGIN: '/login',
  SIGNUP: '/signup',
  UNAUTHORIZED: '/unauthorized',

  // dashboard (protected)
  DASHBOARD: '/dashboard',
  DASHBOARD_AGENT: '/dashboard/agent',
  DASHBOARD_ADMIN: '/dashboard/admin',
  DASHBOARD_BOOKINGS: '/dashboard/bookings',
  DASHBOARD_PROPERTIES: '/dashboard/properties',
  DASHBOARD_SETTINGS: '/dashboard/settings',
} as const;
